import Vue from 'vue';
import Vuetify from 'vuetify/lib/framework';

Vue.use(Vuetify);

export default new Vuetify({
  theme: {
    themes: {
      light: {
        primary: '#F57C00',
        secondary: '#FB8C00',
        accent: '#FF7043',
        info: '#2196F3',
        error: '#FF5252',
        success: '#4CAF50',
        warning: '#FFC107',
      }
    }
  }
});
